import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

const [event, setEvent] = React.useState('');

  return (
    <div>
      <main>
        <p>What are you thinking?</p>
        <form>
          <label htmlFor="event">I'm worried about</label>

          <input type="text" id="event" value={event} onChange={
            (e) => { setEvent(e.target.value) }
          }/>

          <label htmlFor="action1">Because I'm scared I will</label>
          <input type="text" id="action1"/>
          <label htmlFor="action2">and</label>
          <input type="text" id="action2"/>
          <p>resulting {event}</p>
          <label htmlFor="result">to be</label>
          <input type="text" id="result"/>
        </form>


      </main>

    </div>
  );
}

export default App;
